export function onError(error) {
    let message = error.toString();
    let errorCode = message.split("status code ")[1]
    let coldStart = false

    if (errorCode == "504") {
      coldStart = true;
      return coldStart;
    }

    // Auth errors
    if (!(error instanceof Error) && error.message) {
      message = error.message;
    }

    alert(message);
    return coldStart;
  }
